import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
const name="Neha Garg";


const img1="https://picsum.photos/200/300";
const img2="https://picsum.photos/250/300";
const img3="https://picsum.photos/270/300";
const img4="https://picsum.photos/300/300";


ReactDOM.render(
<>
<h1 style={{
    color :'darkblue',
    textAlign: 'center',
    textTransform: 'capitalize',
   fontWeight: 'bold',
   textShadow: '0px 2px 4px #d0bcfd',
  margin:'50px 0',
  fontFamily: 'sans-serif'
  }}> Hi! My name is {name}</h1>

<div className="images">
<img src={img1} alt="gfcg" />
<img src={img2} alt="gfcg" />
<img src={img3} alt="gfcg" />
<img src={img4} alt="gfcg" />
</div></>,document.getElementById("root"));
